import React from 'react';

const Filter = ({filtered,clear}) => {
    if(filtered.length > 0){
        return(
            <div className='filter'>
                <div onClick={clear} className='clear'>
                    Clear
                </div>
            </div>
        )
    }else{
        return (
            <div>

            </div>
        )
    }
}

export default Filter;
